ro. This caused the &#8220;link to additional content&#8221; from the advanced insert/edit link button [&#8230;]<div style="clear:both;padding-top:0.2em;"><a title="Like on Facebook" href="http://feeds.feedblitz.com/_/28/195159840/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/fblike20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Share on Google+" href="http://feeds.feedblitz.com/_/30/195159840/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/googleplus20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Pin it!" href="http://feeds.feedblitz.com/_/29/195159840/wpeditpro,"><img height="20" src="http://assets.feedblitz.com/i/pinterest20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Tweet This" href="http://feeds.feedblitz.com/_/24/195159840/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/twitter20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by email" href="http://feeds.feedblitz.com/_/19/195159840/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/email20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by RSS" href="http://feeds.feedblitz.com/_/20/195159840/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/rss20.png" style="border:0;margin:0;padding:0;"></a>&#160;</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Josh Lobe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3471:"<h2>WP Edit Pro Version 4.4.2</h2>\r\n<p>Another maintenance release fixing two issues; the &#8220;Advanced Insert/Edit Link&#8221; button, and the &#8220;Image Map&#8221; button.</p>\r\n<h3>Advanced Insert/Edit Link Button</h3>\r\n<p>There was an ajax function that did not make it into version 4.4 of WP Edit Pro.  This caused the &#8220;link to additional content&#8221; from the advanced insert/edit link button to not populate any content.  </p>\r\n<p>The function was added back into the new code, and the button now works as expected again.</p>\r\n<h3>Image Map Button</h3>\r\n<p>The image map button is &#8220;growing old&#8221;.  The code used was originally written for Tinymce version 3.0 (about seven years old).  When WordPress made the upgrade from Tinymce 3.0 to Tinymce 4.0 (beginning in WordPress 4.0), the image map button needed to be revised.</p>\r\n<p>Now, in WordPress 4.6, it broke again.  The entire Image Map code is running on deprecated hooks and filters.  Although it is now working again; it is a bit &#8220;unstable&#8221;.  Meaning, this button is going to need to be completely recoded at some point in the near future.</p>\r\n<p>However; all image maps created with the button will still work properly.  When an image map is created; the code for rendering the image maps is saved into the post or page data (then into the database).  So, even if WP Edit Pro is deactivated (or if the image map button is removed); all previously created image maps will still render properly.</p>\r\n<h3>New Help Desk</h3>\r\n<p>About two weeks ago, we made the transition from a support forum to a help desk.  The new help desk is much more organized, personable, and you can even reply to tickets you create via email (or an online portal).</p>\r\n<p>If anyone has any suggestions, feedback, or constructive criticism&#8230; I would love to hear from you.  Please visit the <a href="http://feeds.feedblitz.com/~/t/0/0/wpeditpro/~https://wpeditpro.com/support" target="_blank">WP Edit Pro Help Desk</a> today!</p>\r\n<Img align="left" border="0" height="1" width="1" alt="" style="border:0;float:left;margin:0;padding:0;width:1px!important;height:1px!important;" hspace="0" src="http://feeds.feedblitz.com/~/i/195159840/0/wpeditpro">