blitz.com/i/fblike20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Share on Google+" href="http://feeds.feedblitz.com/_/30/193159904/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/googleplus20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Pin it!" href="http://feeds.feedblitz.com/_/29/193159904/wpeditpro,"><img height="20" src="http://assets.feedblitz.com/i/pinterest20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Tweet This" href="http://feeds.feedblitz.com/_/24/193159904/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/twitter20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by email" href="http://feeds.feedblitz.com/_/19/193159904/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/email20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by RSS" href="http://feeds.feedblitz.com/_/20/193159904/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/rss20.png" style="border:0;margin:0;padding:0;"></a>&#160;</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Josh Lobe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3609:"<h2>WP Edit Pro Version 4.4.1</h2>\r\n<p>This is a maintenance release mostly supporting backwards compatibility for both WordPress and the PHP version used on the server.</p>\r\n<h3>WordPress Backwards Compatibility</h3>\r\n<p>Beginning in WordPress 4.6.0 the use of the <strong>wp_get_sites()</strong> function is deprecated.  Newer WordPress versions make use of the <strong>get_sites()</strong> function. Some users on older versions of WordPress had trouble with the usage of the newer function.</p>\r\n<p>Backwards compatibility was added to work with any WordPress version.  However, it is always recommended to update to the current version of WordPress.  </p>\r\n<h3>PHP Backwards Compatibility</h3>\r\n<p>A function was added in this version of WP Edit Pro to sort custom styles alphabetically in the &#8220;Formats&#8221; dropdown menu.  The function is only available in PHP versions 5.3 and above.</p>\r\n<p>Anyone using PHP versions less than 5.3 were experiencing issues with additional editors loading.  Again, backwards compatibility has been added to support older versions of PHP.  </p>\r\n<h3>About Tab</h3>\r\n<p>Under the about tab; two new fields have been added to explicitly state if the plugin is network activated or activated on a subsite that is part of a network.  Please reference this information when submitting a support ticket.</p>\r\n<h3>Plugin Code Cleanup</h3>\r\n<p>One of the functions used by the plugin checked if the upload directories (where additional user-created WP Edit Pro files are stored) had been created; and if not, it created them.  This function was hooked to the <strong>admin_init()</strong> hook.  Meaning, this upload directory check was running every time the admin page was loaded.</p>\r\n<p>This function has been moved to the <strong>plugin_activate()</strong> hook.  Now, the upload directory check will only occur when the plugin is activated.</p>\r\n<h3>Image Map File</h3>\r\n<p>A javascript file was overlooked and not included with the plugin.  Some users may have seen a 404 error in regards to an image map file when loading pages.  The file has been added back to the plugin; and the error is gone.</p>\r\n<Img align="left" border="0" height="1" width="1" alt="" style="border:0;float:left;margin:0;padding:0;width:1px!important;height:1px!important;" hspace="0" src="http://feeds.feedblitz.com/~/i/193159904/0/wpeditpro">\r\n<div style="clear:both;padding-top:0.2em;"><a title="Like on Facebook" href="http://feeds.feedblitz.com/_/28/193159904/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/fblike20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Share on Google+" href="http://feeds.feedblitz.com/_/30/193159904/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/googleplus20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Pin it!" href="http://feeds.feedblitz.com/_/29/193159904/wpeditpro,"><img height="20" src="http://assets.feedblitz.com/i/pinterest20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Tweet This" href="http://feeds.feedblitz.com/_/24/193159904/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/twitter20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by email" href="http://feeds.feedblitz.com/_/19/193159904/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/email20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by RSS" href="http://feeds.feedblitz.com/_/20/193159904/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/rss20.png" style="border:0;margin:0;padding:0;"></a>&#160;</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:76:"http://feeds.feedblitz.com/~/193159904/0/wpeditpro~WP-Edit-Pro-Version/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:39:"\n\n		\n		\n		\n		\n		\n				\n		\n		\n				\n			\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:46:"https://wpeditpro.com/wp-edit-pro-