n of the File Manager plugin is 3.3</p>\r\n<h3>Removed Items</h3>\r\n<p>The classes and ids options have been removed temporarily.  There was a major javscript issue; and will require further development.  All applied styles from using the classes and ids will still display properly.</p>\r\n<p>The admin bar links (which link to the various WP Edit Pro settings pages) have been removed.</p>\r\n<h3>New Help Desk</h3>\r\n<p>Due to constant excessive spam in the WP Edit Pro support forum, we have opted to move to a ticketing system.  Users can create support tickets and communicate via email, or an online web portal.</p>\r\n<p>Please visit the <a href="http://feeds.feedblitz.com/~/t/0/0/wpeditpro/~https://wpeditpro.com/support">WP Edit Pro Help Desk</a> anytime to create or check on a ticket.</p>\r\n<Img align="left" border="0" height="1" width="1" alt="" style="border:0;float:left;margin:0;padding:0;width:1px!important;height:1px!important;" hspace="0" src="http://feeds.feedblitz.com/~/i/190902212/0/wpeditpro">\r\n<div style="clear:both;padding-top:0.2em;"><a title="Like on Facebook" href="http://feeds.feedblitz.com/_/28/190902212/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/fblike20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Share on Google+" href="http://feeds.feedblitz.com/_/30/190902212/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/googleplus20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Pin it!" href="http://feeds.feedblitz.com/_/29/190902212/wpeditpro,"><img height="20" src="http://assets.feedblitz.com/i/pinterest20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Tweet This" href="http://feeds.feedblitz.com/_/24/190902212/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/twitter20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by email" href="http://feeds.feedblitz.com/_/19/190902212/wpeditpro"><img height="20" src="http://assets.feedblitz.c