dding:0;"></a>&#160;<a title="Subscribe by email" href="http://feeds.feedblitz.com/_/19/138209229/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/email20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by RSS" href="http://feeds.feedblitz.com/_/20/138209229/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/rss20.png" style="border:0;margin:0;padding:0;"></a>&#160;</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Josh Lobe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:7273:"<h2>WP Edit Pro Version 4.3</h2>\r\n<p>This version release is a combination of miscellaneous additions and updates. There are a couple bug-fixes; and one &#8220;hidden&#8221; task where all tinymce button addon languages are being added to the main plugin translation (more on this later).</p>\r\n<h3>Plugin Additions</h3>\r\n<p>Just a couple of new plugin additions.</p>\r\n<h4>jQuery Alerts</h4>\r\n<p>While working on another project, I came across a very nice alert/confirm plugin. It is easy to work with (programmatically), and looks great on web pages. I will continue using this new plugin throughout WP Edit Pro for all alert and confirm messages.</p>\r\n<p><img src="https://wpeditpro.com/wp-content/uploads/2016/02/alert_plugin-300x84.png" alt="alert_plugin" width="300" height="84" class="alignnone size-medium wp-image-1837" srcset="https://wpeditpro.com/wp-content/uploads/2016/02/alert_plugin-300x84.png 300w, https://wpeditpro.com/wp-content/uploads/2016/02/alert_plugin.png 708w" sizes="(max-width: 300px) 100vw, 300px" /></p>\r\n<h4>Disable wpautop</h4>\r\n<p>Additional functionality has been added to the settings page for the option to disable the wpautop filter; allowing mass applying (or removing) the filter from all posts or pages.</p>\r\n<p><img src="https://wpeditpro.com/wp-content/uploads/2016/02/manage_wpautop-300x132.png" alt="manage_wpautop" width="300" height="132" class="alignnone size-medium wp-image-1838" srcset="https://wpeditpro.com/wp-content/uploads/2016/02/manage_wpautop-300x132.png 300w, https://wpeditpro.com/wp-content/uploads/2016/02/manage_wpautop.png 668w" sizes="(max-width: 300px) 100vw, 300px" /></p>\r\n<h4>Disable WP Edit Pro Editor</h4>\r\n<p>Per a request on the free version forums; an option has been added to remove the WP Edit Pro enhanced editor from posts or pages, independently. If desired; WP Edit Pro can be disabled for all posts and/or all pages; resulting in the standard WordPress editor being loaded.</p>\r\n<p><img src="https://wpeditpro.com/wp-content/uploads/2016/02/disable_editor-300x89.png" alt="disable_editor" width="300" height="89" class="alignnone size-medium wp-image-1839" srcset="https://wpeditpro.com/wp-content/uploads/2016/02/disable_editor-300x89.png 300w, https://wpeditpro.com/wp-content/uploads/2016/02/disable_editor.png 531w" sizes="(max-width: 300px) 100vw, 300px" /></p>\r\n<h3>Plugin Updates</h3>\r\n<p>A few plugin updates to keep things on the up-and-up.</p>\r\n<h4>Updated Google Fonts</h4>\r\n<p>A couple users have reported receiving errors on the &#8220;Fonts&#8221; tab (namely, the Google fonts option). The code calling the Google Fonts API has been modified. Please report any continued errors.</p>\r\n<h4>Deprecated Function</h4>\r\n<p>One thing I love about WordPress are the developer notices when a function is deprecated (no longer supported in the API). Two deprecated functions have been replaced with their newer counterparts.</p>\r\n<h4>File Manager</h4>\r\n<p>The file manager code was updated to version 9.9.7. A bug fix was also applied to the WP Edit Pro &#8220;Bonus&#8221; tab; for installing the File Manger plugin. The File Manger plugin update will be released in a few days. There are still a few other items I wish to address before releasing the File Manager update.</p>\r\n<h3>Fixes</h3>\r\n<p>Just a couple small bug fixes:</p>\r\n<ul>\r\n<li>Fixed snidget script loading on all admin pages (when snidgets are enabled); to only load on editor pages where snidgets can be used.</li>\r\n<li>Fixed stylesheet regeneration when a custom font is deleted (prevents console warning when CSS tries to load a deleted custom font).</li>\r\n</ul>\r\n<h3>Convert Options</h3>\r\n<p>The &#8220;Convert Options&#8221; button on the Database tab has been changed.  It NO LONGER converts options from the older WP Edit Pro to the newer WP Edit Pro. Everyone should have had the opportunity to convert options by now.</p>\r\n<p>Instead, the button now converts options from the free version of WP Edit; to the pro version. This will allow new users of WP Edit Pro to convert options which were being used prior on the free version.</p>\r\n<h3>Tinymce Translations</h3>\r\n<p>This will be a task which is slowly implemented over multiple plugin releases. I have decided to add ALL WP Edit Pro Tinymce buttons to the language localization used by WP Edit Pro; allowing plugin translators to fully translate WP Edit Pro.</p>\r\n<p>WP Edit Pro contains over 20 new buttons. Each of these buttons were coded in English (without localization). The code must be updated for each of these plugins. I anticipate this task will take a couple months to complete; and will be added to plugin code as completed. The code will sit silently in the background of the plugin until complete.</p>\r\n<h3>Tinymce Plugins</h3>\r\n<p>Most of the buttons for WP Edit Pro use a tinymce plugin for displaying the window and performing the operations. These windows are ran is iframes on the editor page (when a button is clicked). Some of the buttons require WordPress functions (and jQuery) to perform the operations.</p>\r\n<p>In the past; I have called jQuery from each tinymce plugin. This is a potential problem. As time goes by, jQuery versions are updated. If the path to a specific version of jQuery is hard-coded in the tinymce button; then it will become outdated eventually.</p>\r\n<p>Hence, all tinymce plguins which rely on WordPress functions now load the &#8220;wp-load.php&#8221; file. Many may disagree with calling &#8220;wp-load&#8221; (as there are better methods)&#8230; but in the circumstance of a tinymce plugin that uses an external window (not hooked to WordPress), there is simply no other solution. Please report back if any tinymce buttons/plugins fail to load properly.</p>\r\n<Img align="left" border="0" height="1" width="1" alt="" style="border:0;float:left;margin:0;padding:0;width:1px!important;height:1px!important;" hspace="0" src="http://feeds.feedblitz.com/~/i/138209229/0/wpeditpro">\r\n<div style="clear:both;padding-top:0.2em;"><a title="Like on Facebook" href="http://feeds.feedblitz.com/_/28/138209229/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/fblike20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Share on Google+" href="http://feeds.feedblitz.com/_/30/138209229/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/googleplus20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Pin it!" href="http://feeds.feedblitz.com/_/29/138209229/wpeditpro,https%3a%2f%2fwpeditpro.com%2fwp-content%2fuploads%2f2016%2f02%2falert_plugin-300x84.png"><img height="20" src="http://assets.feedblitz.com/i/pinterest20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Tweet This" href="http://feeds.feedblitz.com/_/24/138209229/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/twitter20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by email" href="http://feeds.feedblitz.com/_/19/138209229/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/email20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by RSS" href="h