ategorized";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"https://wpeditpro.com/?p=1769";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1665:"WP Edit Pro Version 4.2 This release brings along some important fixes, as well as a few new options. Custom Fonts After much testing and ensuring system security is maintained, I am proud to bring back an updated version of Custom Fonts. In this version; maximum browser compatibility is encouraged by displaying handy messages to [&#8230;]<div style="clear:both;padding-top:0.2em;"><a title="Like on Facebook" href="http://feeds.feedblitz.com/_/28/134237101/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/fblike20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Share on Google+" href="http://feeds.feedblitz.com/_/30/134237101/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/googleplus20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Pin it!" href="http://feeds.feedblitz.com/_/29/134237101/wpeditpro,https%3a%2f%2fwpeditpro.com%2fwp-content%2fuploads%2f2016%2f01%2fcustom_fonts1.png"><img height="20" src="http://assets.feedblitz.com/i/pinterest20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Tweet This" href="http://feeds.feedblitz.com/_/24/134237101/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/twitter20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by email" href="http://feeds.feedblitz.com/_/19/134237101/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/email20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by RSS" href="http://feeds.feedblitz.com/_/20/134237101/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/rss20.png" style="border:0;margin:0;padding:0;"></a>&#160;</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Josh Lobe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:6527:"<h2>WP Edit Pro Version 4.2</h2>\r\n<p>This release brings along some important fixes, as well as a few new options.</p>\r\n<h3>Custom Fonts</h3>\r\n<p>After much testing and ensuring system security is maintained, I am proud to bring back an updated version of Custom Fonts.</p>\r\n<p>In this version; maximum browser compatibility is encouraged by displaying handy messages to the user if all font types are not uploaded.  Additionally, <a href="http://feeds.feedblitz.com/~/t/0/0/wpeditpro/~www.fontsquirrel.com/tools/webfont-generator" target="_blank">Font Squirrel</a> can be used to convert and generate all necessary font types, from a single .ttf or .otf font.</p>\r\n<p>This makes it truly easy to use custom fonts both on your website and inside the content editor.  A detailed tutorial fill follow shortly on the <a href="http://feeds.feedblitz.com/~/t/0/0/wpeditpro/~learn.wpeditpro.com" target="_blank">WP Edit Pro Knowledge Base</a>.</p>\r\n<p><img src="https://wpeditpro.com/wp-content/uploads/2016/01/custom_fonts1.png" alt="custom_fonts1" width="1642" height="533" class="alignnone size-full wp-image-1778" /></p>\r\n<p><img src="https://wpeditpro.com/wp-content/uploads/2016/01/custom_fonts2.png" alt="custom_fonts2" width="1417" height="540" class="alignnone size-full wp-image-1779" /></p>\r\n<p><img src="https://wpeditpro.com/wp-content/uploads/2016/01/custom_fonts3.png" alt="custom_fonts3" width="300" height="181" class="alignnone size-medium wp-image-1780" /></p>\r\n<h3>Added Flickr Image Search</h3>\r\n<p>Since the Google Images API is now deprecated (<a href="http://feeds.feedblitz.com/~/t/0/0/wpeditpro/~https://developers.google.com/image-search/?hl=en" target="_blank">Read more here&#8230;</a>), I was forced to find another solution for web image searching and editor insertion.</p>\r\n<p>Most of the options are now paid services (Google, Yahoo, Bing), limiting daily search queries to around 100 on their free API&#8217;s. While this might be okay for a single user; it is just not practical for the masses. Instead, I decided to use the Flickr Image API.</p>\r\n<p>With Flickr, you may submit unlimited search queries. The results are nicely paginated, and each image may be previewed before being inserted into the editor.</p>\r\n<p><img src="https://wpeditpro.com/wp-content/uploads/2016/01/cats_flickr.png" alt="cats_flickr" width="1530" height="716" class="alignnone size-full wp-image-1770" /></p>\r\n<h3>Disable WPautoP</h3>\r\n<p>The functions used for helping to retain p and br tags, and prevent stripping of html tags when saving or switching editor views; has been fixed and added back into the plugin.</p>\r\n<p>Remember, the option to disable wpautop is a global option. Once set, you can then toggle each post/page. Also, you can set which post types have the option available to disable the wpautop filter.</p>\r\n<p><img src="https://wpeditpro.com/wp-content/uploads/2016/01/autop1.png" alt="autop1" width="785" height="64" class="alignnone size-full wp-image-1772" /></p>\r\n<p><img src="https://wpeditpro.com/wp-content/uploads/2016/01/autop2.png" alt="autop2" width="400" height="220" class="alignleft size-full wp-image-1773" /><img src="https://wpeditpro.com/wp-content/uploads/2016/01/autop3.png" alt="autop3" width="280" height="310" class="alignleft size-full wp-image-1774" /></p>\r\n<h3>Profile Biography Section</h3>\r\n<p>A few users have reported issues when using the editor on the profile description section. I believe the issue is the profile section is a common page that other plugins/themes may customize.  Since WP Edit Pro uses a copy/replace method on the profile biography section, the javscript can become &#8220;wonky&#8221; if other changes are being made to the page.</p>\r\n<p>This update uses a different approach to the profile editor. Still based in jquery; but doesn&#8217;t rely on the position of other page elements.</p>\r\n<p><img src="https://wpeditpro.com/wp-content/uploads/2016/01/profile_editor.png" alt="profile_editor" width="1722" height="392" class="alignnone size-full wp-image-1777" /></p>\r\n<h3>Other Fixes and Updates</h3>\r\n<p>Just a few other things worth nothing:</p>\r\n<ul>\r\n<li>Fixed Feedblitz url on https websites.</li>\r\n<li>Fixed upload directory creation (for custom fonts and style sheets); so now only loads on admin pages.</li>\r\n<li>Fixed custom styles when saving a name with an apostrophe in the title.</li>\r\n<li>Fixed incompatibility issue between WP Edit Pro, Revolution Slider, and WPML.</li>\r\n<li>Updated QR Widget to maintain PHP 7 class structure integrity.</li>\r\n<li>Updated plugin language localization. An incorrect file made translations impossible. This is now fixed.</li>\r\n</ul>\r\n<h3>Closing</h3>\r\n<p>That&#8217;s it for this release. Quite a few bugs squashed; and also brought back some much needed/deserved options.</p>\r\n<p>Please feel free to leave any feedback on the <a href="http://feeds.feedblitz.com/~/t/0/0/wpeditpro/~forum.wpeditpro.com" target="_blank">WP Edit Pro Support Forum</a>.</p>\r\n<Img align="left" border="0" height="1" width="1" alt="" style="border:0;float:left;margin:0;padding:0;width:1px!important;height:1px!important;" hspace="0" src="http://feeds.feedblitz.com/~/i/134237101/0/wpeditpro">\r\n<div style="clear:both;padding-top:0.2em;"><a title="Like on Facebook" href="http://feeds.feedblitz.com/_/28/134237101/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/fblike20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Share on Google+" href="http://feeds.feedblitz.com/_/30/134237101/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/googleplus20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Pin it!" href="http://feeds.feedblitz.com/_/29/134237101/wpeditpro,https%3a%2f%2fwpeditpro.com%2fwp-content%2fuploads%2f2016%2f01%2fcustom_fonts1.png"><img height="20" src="http://assets.feedblitz.com/i/pinterest20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Tweet This" href="http://feeds.feedblitz.com/_/24/134237101/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/twitter20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by email" href="http://feeds.feedblitz.com/_/19/134237101/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/email20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by RSS" href="http://feeds.feedblitz.com/_/20/134237101/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/rss20.png" style="border:0;margin:0;padding:0;"></a>&#160;</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:76:"http://feeds.feedblitz.com/~/134237101/0/wpeditpro~WP-Edit-Pro-Version/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:39:"\n\n		\n		\n		\n		\n		\n				\n		\n		\n				\n			\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:48:"https://wpeditpro.com/wp-edit-pro-version-4-1-2/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:25:"WP Edit Pro Version 4.1.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:71:"http://feeds.feedblitz.com/~/120125031/0/wpeditpro~WP-Edit-Pro-Version/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:79:"http://feeds.feedblitz.com/~/120125031/0/wpeditpro~WP-Edit-Pro-Version/#respond";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 25 Oct 2015 06:03:03 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"Uncategorized";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"https://wpeditpro.com/?p=1758";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1588:"WP Edit Pro Version 4.1.2 The main purpose of this release is to tone down the product licensing system. Moving forward; only the transaction ID will be required when interacting with the WP Edit Pro license activation page. License Activation The license email and license key fields have been removed from the license activation page. [&#8230;]<div style="clear:both;padding-top:0.2em;"><a title="Like on Facebook" href="http://feeds.feedblitz.com/_/28/120125031/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/fblike20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Share on Google+" href="http://feeds.feedblitz.com/_/30/120125031/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/googleplus20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Pin it!" href="http://feeds.feedblitz.com/_/29/120125031/wpeditpro,"><img height="20" src="http://assets.feedblitz.com/i/pinterest20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Tweet This" href="http://feeds.feedblitz.com/_/24/120125031/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/twitter20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by email" href="http://feeds.feedblitz.com/_/19/120125031/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/email20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by RSS" href="http://feeds.feedblitz.com/_/20/120125031/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/rss20.png" style="border:0;margin:0;padding:0;"></a>&#160;</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Josh Lobe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2622:"<h2>WP Edit Pro Version 4.1.2</h2>\r\n<p>The main purpose of this release is to tone down the product licensing system.  Moving forward; only the transaction ID will be required when interacting with the WP Edit Pro license activation page.</p>\r\n<h3>License Activation</h3>\r\n<p>The license email and license key fields have been removed from the license activation page.  This should not affect current activations.  The license key and license email values will simply be ignored.</p>\r\n<p>Since only the transaction ID is used on the licensing page; the input field is now readable, meaning the transaction ID will display it&#8217;s value rather than black dots.</p>\r\n<h3>Network Activation Bug</h3>\r\n<p>There was a bug where the plugin would show network values if the plugin had been network activated; even if the plugin was now used on a sub-site.  Meaning if values existed in the network activation; they were always used.  This has been fixed.</p>\r\n<h3>Advanced Numbered List and Bulleted List</h3>\r\n<p>Per request; the advanced bullets and numbers lists has been added to the plugin.  Please save the buttons options to display the two new buttons.</p>\r\n<Img align="left" border="0" height="1" width="1" alt="" style="border:0;float:left;margin:0;padding:0;width:1px!important;height:1px!important;" hspace="0" src="http://feeds.feedblitz.com/~/i/120125031/0/wpeditpro">\r\n<div style="clear:both;padding-top:0.2em;"><a title="Like on Facebook" href="http://feeds.feedblitz.com/_/28/120125031/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/fblike20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Share on Google+" href="http://feeds.feedblitz.com/_/30/120125031/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/googleplus20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Pin it!" href="http://feeds.feedblitz.com/_/29/120125031/wpeditpro,"><img height="20" src="http://assets.feedblitz.com/i/pinterest20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Tweet This" href="http://feeds.feedblitz.com/_/24/120125031/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/twitter20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by email" href="http://feeds.feedblitz.com/_/19/120125031/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/email20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by RSS" href="http://feeds.feedblitz.com/_/20/120125031/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/rss20.png" style="border:0;margin:0;padding:0;"></a>&#160;</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:76:"http://feeds.feedblitz.com/~/120125031/0/wpeditpro~WP-Edit-Pro-Version/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:39:"\n\n		\n		\n		\n		\n		\n				\n		\n		\n				\n			\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:48:"https://wpeditpro.com/wp-edit-pro-version-4-1-1/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:25:"WP Edit Pro Version 4.1.1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:71:"http://feeds.feedblitz.com/~/119260477/0/wpeditpro~WP-Edit-Pro-Version/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:79:"http://feeds.feedblitz.com/~/119260477/0/wpeditpro~WP-Edit-Pro-Version/#respond";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 21 Oct 2015 16:10:48 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"Uncategorized";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"https://wpeditpro.com/?p=1753";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1588:"WP Edit Pro Version 4.1.1 IMPORTANT SECURITY RELEASE &#8211; Please Update Immediately I believe a security vulnerability has been found in WP Edit Pro. Specifically; it pertains to the script used to upload custom fonts. For this reason, I have temporarily removed the custom fonts option. I will replace this option with a more secure [&#8230;]<div style="clear:both;padding-top:0.2em;"><a title="Like on Facebook" href="http://feeds.feedblitz.com/_/28/119260477/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/fblike20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Share on Google+" href="http://feeds.feedblitz.com/_/30/119260477/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/googleplus20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Pin it!" href="http://feeds.feedblitz.com/_/29/119260477/wpeditpro,"><img height="20" src="http://assets.feedblitz.com/i/pinterest20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Tweet This" href="http://feeds.feedblitz.com/_/24/119260477/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/twitter20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by email" href="http://feeds.feedblitz.com/_/19/119260477/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/email20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by RSS" href="http://feeds.feedblitz.com/_/20/119260477/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/rss20.png" style="border:0;margin:0;padding:0;"></a>&#160;</div>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Josh Lobe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2307:"<h2>WP Edit Pro Version 4.1.1</h2>\r\n<h3>IMPORTANT SECURITY RELEASE &#8211; Please Update Immediately</h3>\r\n<p>I believe a security vulnerability has been found in WP Edit Pro.  Specifically; it pertains to the script used to upload custom fonts.  For this reason, I have temporarily removed the custom fonts option.</p>\r\n<p>I will replace this option with a more secure approach in the next plugin version.</p>\r\n<h4>Miscellaneous</h4>\r\n<p>Some other small tweaks in this version include:</p>\r\n<p>1) A license check was performed whenever the plugin options were saved.  This sometimes caused legitimately registered licenses to self-deactivate.  This particular license check has been removed from the plugin.</p>\r\n<p>2) The dropbox API key alert has been removed.</p>\r\n<p>3) The license extension url in the admin notice has been corrected.</p>\r\n<Img align="left" border="0" height="1" width="1" alt="" style="border:0;float:left;margin:0;padding:0;width:1px!important;height:1px!important;" hspace="0" src="http://feeds.feedblitz.com/~/i/119260477/0/wpeditpro">\r\n<div style="clear:both;padding-top:0.2em;"><a title="Like on Facebook" href="http://feeds.feedblitz.com/_/28/119260477/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/fblike20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Share on Google+" href="http://feeds.feedblitz.com/_/30/119260477/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/googleplus20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Pin it!" href="http://feeds.feedblitz.com/_/29/119260477/wpeditpro,"><img height="20" src="http://assets.feedblitz.com/i/pinterest20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Tweet This" href="http://feeds.feedblitz.com/_/24/119260477/wpeditpro"><img height="20" src="http://assets.feedblitz.com/i/twitter20.png" style="border:0;margin:0;padding:0;"></a>&#160;<a title="Subscribe by ema