dcamp-bordeaux-embarquons-sur-li-boat/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 08 Mar 2017 11:01:45 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:405:"\n		        Que serait un WordCamp sans sa traditionnelle soirée communautaire ? Pour les novices, cette soirée, généralement organisée juste après le WordCamp, permet aux participants de poursuivre les rencontres et échanges de la journée, dans la bonne humeur et autour d&#8217;un verre ou de bons petits plats. Nous donnons donc rendez-vous aux détenteurs et détentrices de [&#8230;]		        ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:17:"WordCamp Bordeaux";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3328:"<p>Que serait un WordCamp sans sa traditionnelle soirée communautaire ? Pour les novices, cette soirée, généralement organisée juste après le WordCamp, permet aux participants de poursuivre les rencontres et échanges de la journée, dans la bonne humeur et autour d&rsquo;un verre ou de bons petits plats.</p>\n<p>Nous donnons donc rendez-vous aux détenteurs et détentrices de billets « Pressoir » le samedi 18 mars 2017 à 19H, pour clore ce WordCamp Bordeaux 2017 de manière conviviale !</p>\n<h2>L&rsquo;I.BOAT</h2>\n<p>Pour l&rsquo;occasion,<strong> l&rsquo;équipe de WordCamp Bordeaux vous convie à l&rsquo;<a href="http://www.iboat.eu/" target="_blank">I.BOAT</a></strong>, lieu tendance et atypique de Bordeaux, installé sur un ancien ferry à trois niveaux dans le quartier des Bassins à flot. À la fois salle de concert, club, bar, lieu de détente et restaurant, l&rsquo;I.BOAT est un des projets culturels incontournables de Bordeaux.</p>\n<p>Pour les plus frileux·ses, pas de panique ! La soirée se déroulera dans une salle fermée, chauffée et très confortable. Évidemment, un bar sera à notre disposition – la première tournée est pour nous – et l&rsquo;I.BOAT dispose également d&rsquo;un restaurant, <a href="http://www.iboat.eu/Accueil/Restaurant.sls" target="_blank">La Cantine</a>, qui nous permettra de sustenter nos estomacs affamés. La carte est créative et composée de <strong>produits frais et de saison ; des plats végétariens et végétaliens</strong> sont également proposés.</p>\n<p><img class="alignnone size-large wp-image-1546" src="https://i0.wp.com/2017.bordeaux.wordcamp.org/files/2017/01/iboat-web-03.jpg?resize=990%2C660" alt="" /></p>\n<p><strong>Votre badge WordCamp Bordeaux vous donne accès à la soirée</strong> : ne l&rsquo;oubliez surtout pas, vous en aurez besoin pour entrer !</p>\n<h2>Comment s&rsquo;y rendre ?</h2>\n<div class="googlemaps"></div>\n<p>L&rsquo;I.BOAT se situe dans le quartier des Bassins à flots, à 5 minutes de tram de la Cité Mondiale &#8211; Centre des Congrès (Tram B, direction Berges de la Garonne, Arrêt La Cité du Vin). Pour vous y rendre, il vous faudra marcher entre 5 et 10 minutes supplémentaires après être descendu·e·s du tram, ce qui vous permettra de vous dégourdir les jambes !</p>\n<p><img class="alignnone size-medium wp-image-1543" src="https://i0.wp.com/2017.bordeaux.wordcamp.org/files/2017/01/iboat-web-01.jpg?resize=300%2C200" alt="" /><br />\n<strong>Soirée Communautaire WordCamp Bordeaux 2017</strong><br />\nI.BOAT<br />\nBassin à Flot n°1, Quai Armand Lalande, 33300 Bordeaux<br />\n<em>à partir de 19H</em><br />\n<a href="http://www.iboat.eu/" target="_blank">www.iboat.eu</a></p>\n<p>La soirée communautaire est à ce jour complète, mais pas de panique ! Nous vous proposerons dès demain une liste de bonnes adresses pour prolonger quand même la journée de conférences en compagnie des WordPressien·ne·s du WordCamp.</p>\n<p><strong>Vous n’avez pas encore pris votre billet ? Qu&rsquo;attendez-vous ?</strong><br />\n<a href="https://2017.bordeaux.wordcamp.org/billets" class="cta"><span class="dashicons-before dashicons-tickets">BILLETTERIE</span><span>C&rsquo;est parti ! »</span></a></p><img src="http://feeds.feedburner.com/~r/wpfr/~4/uGUkjtK3m6g" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:111:"https://2017.bordeaux.wordcamp.org/2017/03/08/soiree-communautaire-de-wordcamp-bordeaux-embarquons-sur-li-boat/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:84:"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:41:"Ajouter du CSS additionnel sous WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpfr/~3/RrdlQuO3bGo/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:56:"https://wpchannel.com/ajouter-css-additionnel-wordpress/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 08 Mar 2017 09:37:22 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:466:"\n		        L&#8217;ajout de code CSS pers