(79, 1, '2017-02-10 14:25:15', '2017-02-10 13:25:15', '<img class="aligncenter wp-image-80 size-medium" src="http://localhost/ville-de-massalia/wp-content/uploads/2017/02/concours-ecriture-300x152.jpg" width="300" height="152" />\r\n\r\nLe réseau de médiathèques organise pour la 4ème année consécutive son concours d’écriture « Nouvelles de mai ».\r\n\r\nJusqu’au 5 mai 2017, vous pouvez déposer votre nouvelle dans une des médiathèques du réseau ou par courrier à la médiathèque de Massalia.\r\n\r\nCette année la contrainte consiste à poursuivre 3 textes écrits chacun par un auteur local dont les noms seront divulgués lors de la remise des prix.\r\n\r\nAlors à vos plumes et à votre imagination !\r\n\r\nLe réseau invite également les enfants et les jeunes de moins de 20 ans à prendre la plume pour envoyer avant le 7 mars des textes qui peuvent être des nouvelles, des contes, des bandes dessinées, des poèmes, des articles journalistiques, etc…\r\n\r\nLes résultats seront donnés le samedi 27 mai 2017 à la médiathèque.\r\n\r\nVous trouverez les règlements complets sur le site du<a href="http://localhost/ville-de-massalia/le-quotidien/loisirs/"> réseau des médiathèques du pays de Massalia. </a>', 'Concours de nouvelles et jeu d''écriture', '', 'publish', 'open', 'open', '', 'concours-de-nouvelles-et-jeu-decriture', '', '', '2017-02-10 14:40:33', '2017-02-10 13:40:33', '', 0, 'http://localhost/ville-de-massalia/?p=79', 0, 'post', '', 0),
(80, 1, '2017-02-10 14:19:04', '2017-02-10 13:19:04', '', 'concours-ecriture', '', 'inherit', 'open', 'closed', '', 'concours-ecriture', '', '', '2017-02-10 14:19:04', '2017-02-10 13:19:04', '', 79, 'http://localhost/ville-de-massalia/wp-content/uploads/2017/02/concours-ecriture.jpg', 0, 'attachment', 'image/jpeg', 0),
(81, 1, '2017-02-10 14:25:15', '2017-02-10 13:25:15', '<img class="aligncenter wp-image-80 size-medium" src="http://localhost/ville-de-massalia/wp-content/uploads/2017/02/concours-ecriture-300x152.jpg" width="300" height="152" />\r\n\r\nLe réseau de médiathèques organise pour la 4ème année consécutive son concours d’écriture « Nouvelles de mai ».\r\n\r\nJusqu’au 5 mai 2017, vous pouvez déposer votre nouvelle dans une des médiathèques du réseau ou par courrier à la médiathèque de Massalia.\r\n\r\nCette année la contrainte consiste à poursuivre 3 textes écrits chacun par un auteur local dont les noms seront divulgués lors de la remise des prix.\r\n\r\nAlors à vos plumes et à votre imagination !\r\n\r\nLe réseau invite également les enfants et les jeunes de moins de 20 ans à prendre la plume pour envoyer avant le 7 mars des textes qui peuvent être des nouvelles, des contes, des bandes dessinées, des poèmes, des articles journalistiques, etc…\r\n\r\nLes résultats seront donnés le samedi 27 mai 2017 à la médiathèque.\r\n\r\nVous trouverez les règlements complets sur le site du<a href="http://localhost/ville-de-massalia/le-quotidien/loisirs/"> réseau des médiathèques du pays de Massalia. </a>', 'Concours de nouvelles et jeu d''écriture', '', 'inherit', 'closed', 'closed', '', '79-revision-v1', '', '', '2017-02-10 14:25:15', '2017-02-10 13:25:15', '', 79, 'http://localhost/ville-de-massalia/2017/02/10/79-revision-v1/', 0, 'revision', '', 0),
(82, 1, '2017-02-10 14:26:16', '2017-02-10 13:26:16', 'Bienvenue dans WordPress. Ceci est votre premier article. Modifiez-le ou supprimez-le, puis lancez-vous&nbsp;!', 'Bonjour tout le monde&nbsp;!', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2017-02-10 14:26:16', '2017-02-10 13:26:16', '', 1, 'http://localhost/ville-de-massalia/2017/02/10/1-revision-v1/', 0, 'revision', '', 0),
(84, 1, '2017-02-10 14:31:18', '2017-02-10 13:31:18', '[caption id="attachment_72" align="alignleft" width="300"]<img class="wp-image-72 size-medium" src="http://localhost/ville-de-massalia/wp-content/uploads/2017/02/zone-bleue-300x223.jpg" alt="zone bleu" width="300" height="223" /> Rue du Château en zone bleue[/caption]\r\n\r\nUne zone bleue a été créée côté impair de la route du Château.\r\n\r\nCe dispositif a pour objectif de fluidifier le stationnement et favoriser l’accès aux commerçants face à l’augmentation sans cesse croissante du parc automobile sur cette zone.\r\n\r\nLe stationnement réglementé s’applique <strong>tous les jours</strong> de la semaine, à l’exception du dimanche, de <strong>9H00 à 19H00 sans interruption</strong>. La durée est <strong>limitée à 1H30</strong> et nécessite l’utilisation d’un disque réglementaire de type européen.\r\n\r\nLe non-respect de cette disposition est passible d’une <strong>amende de 17 euros</strong>.\r\n\r\nCette zone bleue pourra être étendue à d’autres voies de la commune.\r\n\r\nAu niveau de la sécurité, pour faciliter l’ouverture des portières des véhicules et permettre aux passagers de descendre côté trottoir, les plantations ont été enlevées et un revêtement spécifique installé sur les parterres.', 'Création d’une zone bleue en centre-ville', '', 'publish', 'open', 'open', '', 'creation-dune-zone-bleue-en-centre-ville', '', '', '2017-02-10 14:39:59', '2017-02-10 13:39:59', '', 0, 'http://localhost/ville-de-massalia/?p=84', 0, 'post', '', 0),
(85, 1, '2017-02-10 14:31:18', '2017-02-10 13:31:18', '[caption id="attachment_72" align="alignleft" width="300"]<img class="wp-image-72 size-medium" src="http://localhost/ville-de-massalia/wp-content/uploads/2017/02/zone-bleue-300x223.jpg" alt="zone bleu" width="300" height="223" /> Rue du Château en zone bleue[/caption]\r\n\r\nUne zone bleue a été créée côté impair de la route du Château.\r\n\r\nCe dispositif a pour objectif de fluidifier le stationnement et favoriser l’accès aux commerçants face à l’augmentation sans cesse croissante du parc automobile sur cette zone.\r\n\r\nLe stationnement réglementé s’applique <strong>tous les jours</strong> de la semaine, à l’exception du dimanche, de <strong>9H00 à 19H00 sans interruption</strong>. La durée est <strong>limitée à 1H30</strong> et nécessite l’utilisation d’un disque réglementaire de type européen.\r\n\r\nLe non-respect de cette disposition est passible d’une <strong>amende de 17 euros</strong>.\r\n\r\nCette zone bleue pourra être étendue à d’autres voies de la commune.\r\n\r\nAu niveau de la sécurité, pour faciliter l’ouverture des portières des véhicules et permettre aux passagers de descendre côté trottoir, les plantations ont été enlevées et un revêtement spécifique installé sur les parterres.', 'Création d’une zone bleue en centre-ville', '', 'inherit', 'closed', 'closed', '', '84-revision-v1', '', '', '2017-02-10 14:31:18', '2017-02-10 13:31:18', '', 84, 'http://localhost/ville-de-massalia/2017/02/10/84-revision-v1/', 0, 'revision', '', 0),
(86, 1, '2017-02-10 14:35:44', '2017-02-10 13:35:44', '<h2>Dimanche 12 avril 2017</h2>\r\n[caption id="attachment_73" align="alignleft" width="300"]<img class="size-medium wp-image-73" src="http://localhost/ville-de-massalia/wp-content/uploads/2017/02/foire-a-tout-300x245.jpg" alt="La foire à tout et aux livres" width="300" height="245" /> Foire à tout 2016 sur la place de la Mairie[/caption]\r\n\r\nCette animation se déroulera comme d‘habitude au centre de la ville, place de la Mairie de 7h00 à 18h00.\r\n\r\nAu cours de la journée une restauration est mise en place : galettes, crêpes, boissons chaudes et froides vous seront proposées et vous pourrez les déguster sur place, sous le chapiteau mis à votre disposition\r\n\r\nL’accès à toutes les animations est gratuit pour les visiteurs.\r\n\r\nSi vous souhaitez prendre un stand, vous trouverez prendre un stand, vous trouverez un bulletin d‘inscription sur le site de l’association <a href="http://localhost/ville-de-massalia/le-quotidien/loisirs/">Loisirs à Massalia</a>.', 'La foire à tout et aux livres', 'Dimanche 12 de 7h00 à18h00 place de la mairie, évenement gratuit.', 'publish', 'open', 'open', '', 'la-foire-a-tout-et-aux-livres', '', '', '2017-02-10 15:27:07', '2017-02-10 14:27:07', '', 0, 'http://localhost/ville-de-massalia/?p=86', 0, 'post', '', 0),
(87, 1, '2017-02-10 14:35:44', '2017-02-10 13:35:44', '<h2>Dimanche 12 avril 2017</h2>\r\n[caption id="attachment_73" align="alignleft" width="300"]<img class="size-medium wp-image-73" src="http://localhost/ville-de-massalia/wp-content/uploads/2017/02/foire-a-tout-300x245.jpg" alt="La foire à tout et aux livres" width="300" height="245" /> Foire à tout 2016 sur la place de la Mairie[/caption]\r\n\r\nCette animation se déroulera comme d‘habitude au centre de la ville, place de la Mairie de 7h00 à 18h00.\r\n\r\nAu cours de la journée une restauration est mise en place : galettes, crêpes, boissons chaudes et froides vous seront proposées et vous pourrez les déguster sur place, sous le chapiteau mis à votre disposition\r\n\r\nL’accès à toutes les animations est gratuit pour les visiteurs.\r\n\r\nSi vous souhaitez prendre un stand, vous trouverez prendre un stand, vous trouverez un bulletin d‘inscription sur le site de l’association <a href="http://localhost/ville-de-massalia/le-quotidien/loisirs/">Loisirs à Massalia</a>.', 'La foire à tout et aux livres', '', 'inherit', 'closed', 'closed', '', '86-revision-v1', '', '', '2017-02-10 14:35:44', '2017-02-10 13:35:44', '', 86, 'http://localhost/ville-de-massalia/2017/02/10/86-revision-v1/', 0, 'revision', '', 0),
