(94, 1, '2017-02-10 15:09:29', '2017-02-10 14:09:29', '<h2>Dimanche 12 avril 2017</h2>\n[caption id="attachment_73" align="alignleft" width="300"]<img class="size-medium wp-image-73" src="http://localhost/ville-de-massalia/wp-content/uploads/2017/02/foire-a-tout-300x245.jpg" alt="La foire à tout et aux livres" width="300" height="245" /> Foire à tout 2016 sur la place de la Mairie[/caption]\n\nCette animation se déroulera comme d‘habitude au centre de la ville, place de la Mairie de 7h00 à 18h00.\n\nAu cours de la journée une restauration est mise en place : galettes, crêpes, boissons chaudes et froides vous seront proposées et vous pourrez les déguster sur place, sous le chapiteau mis à votre disposition\n\nL’accès à toutes les animations est gratuit pour les visiteurs.\n\nSi vous souhaitez prendre un stand, vous trouverez prendre un stand, vous trouverez un bulletin d‘inscription sur le site de l’association <a href="http://localhost/ville-de-massalia/le-quotidien/loisirs/">Loisirs à Massalia</a>.', 'La foire à tout et aux livres', 'Dimanche 12 de 7', 'inherit', 'closed', 'closed', '', '86-autosave-v1', '', '', '2017-02-10 15:09:29', '2017-02-10 14:09:29', '', 86, 'http://localhost/ville-de-massalia/2017/02/10/86-autosave-v1/', 0, 'revision', '', 0),
(95, 1, '2017-02-10 15:10:21', '2017-02-10 14:10:21', '<h2>Dimanche 12 avril 2017</h2>\r\n[caption id="attachment_73" align="alignleft" width="300"]<img class="size-medium wp-image-73" src="http://localhost/ville-de-massalia/wp-content/uploads/2017/02/foire-a-tout-300x245.jpg" alt="La foire à tout et aux livres" width="300" height="245" /> Foire à tout 2016 sur la place de la Mairie[/caption]\r\n\r\nCette animation se déroulera comme d‘habitude au centre de la ville, place de la Mairie de 7h00 à 18h00.\r\n\r\nAu cours de la journée une restauration est mise en place : galettes, crêpes, boissons chaudes et froides vous seront proposées et vous pourrez les déguster sur place, sous le chapiteau mis à votre disposition\r\n\r\nL’accès à toutes les animations est gratuit pour les visiteurs.\r\n\r\nSi vous souhaitez prendre un stand, vous trouverez prendre un stand, vous trouverez un bulletin d‘inscription sur le site de l’association <a href="http://localhost/ville-de-massalia/le-quotidien/loisirs/">Loisirs à Massalia</a>.', 'La foire à tout et aux livres', 'Dimanche 12 de 7h00 à18h00 place de la mairie, évenement gratuit.', 'inherit', 'closed', 'closed', '', '86-revision-v1', '', '', '2017-02-10 15:10:21', '2017-02-10 14:10:21', '', 86, 'http://localhost/ville-de-massalia/2017/02/10/86-revision-v1/', 0, 'revision', '', 0),
(96, 1, '2017-02-10 15:24:19', '2017-02-10 14:24:19', '[toc]\r\n<h2><span style="color: #993366;">Situation géographique</span></h2>\r\n[caption id="attachment_52" align="alignleft" width="279"]<img class="wp-image-52" src="http://localhost/ville-de-massalia/wp-content/uploads/2017/02/localisation-massalia.jpg" alt="Massalia située au sud de Montfort " width="279" height="181" /> Localisation de la ville de Massalia @Ville de Massalia[/caption]\r\n\r\nLa commune de Massalia se situe dans le département des Yvelines, près de la forêt de Rambouillet. Elle possède une situation privilégiée à 45 km de Paris et proche d’un axe routier important.\r\n\r\nToutefois, Massalia a su conserver son aspect rural de village d’Ile de France. En effet, les espaces agricoles et boisés sont étendus et l’urbanisation est limitée.\r\n\r\nMassalia fait partie  du <a href="http://www.parc-naturel-chevreuse.fr/">Parc naturel régional de la haute vallée de Chevreuse.</a>\r\n<h2></h2>\r\nLes équipements communaux se trouvent principalement au centre du bourg :\r\n<ul>\r\n 	<li>la mairie, la maison des associations, la médiathèque,</li>\r\n 	<li>le groupe scolaire avec 6 classes de primaire et 3 classes de maternelle, la cantine scolaire,</li>\r\n 	<li>les installations sportives et de loisirs au square Lafayette avec 4 courts de tennis, un terrain de basket et de volley-ball, un terrain de jeux de boules et des espaces de jeux pour les enfants.</li>\r\n</ul>\r\nPour localiser les équipements, vous pouvez  télécharger <a href="http://localhost/ville-de-massalia/wp-content/uploads/2017/02/plan-de-la-ville-de-Massalia.pdf">plan-de-la-ville-de-Massalia</a>\r\n<h2><span style="color: #993366;">Vie sociale et économique</span></h2>\r\nMassalia compte diverses associations : sportives (gymnastique, volley, badminton, vélo, course à pied), culturelles (sorties théâtre, initiations musicales, concert, chorales), clubs du 3ème âge… Pour plus d’informations, consulter les pages  «<a href="http://localhost/ville-de-massalia/le-quotidien/loisirs/"> Loisirs </a>» et <a href="http://localhost/ville-de-massalia/le-quotidien/social/">« Social »</a>.\r\n\r\nElle possède un tissu économique dynamique avec sa zone d’activités où plusieurs entreprises se sont installées.\r\n<h2><span style="color: #993366;">Démographie</span></h2>\r\nAu cours du temps, la population a augmenté de façon constante. Entre 1990 et 1999, l’excédent naturel a contribué à la hausse de la population. En effet, entre les deux derniers recensements, on a enregistré 140 naissances et 89 décès dans la commune.\r\n<table><caption>Évolution de la population</caption>\r\n<tbody>\r\n<tr>\r\n<th scope="row">Année</th>\r\n<td>1962</td>\r\n<td>1968</td>\r\n<td>1975</td>\r\n<td>1982</td>\r\n<td>1990</td>\r\n<td>1999</td>\r\n<td>2008</td>\r\n</tr>\r\n<tr>\r\n<th scope="row">Population</th>\r\n<td>750</td>\r\n<td>820</td>\r\n<td>1021</td>\r\n<td>1120</td>\r\n<td>1340</td>\r\n<td>1700</td>\r\n<td>1752</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;', 'Présentation', 'Situation géographique, Équipements communaux, Vie sociale et économique,  Démographie', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2017-02-10 15:24:19', '2017-02-10 14:24:19', '', 18, 'http://localhost/ville-de-massalia/2017/02/10/18-revision-v1/', 0, 'revision', '', 0),
