(42, 1, 'xdfs_yoast_notifications', 'a:4:{i:0;a:2:{s:7:"message";s:175:"Puisque vous êtes un nouvel utilisateur de Yoast SEO, vous pouvez configurer l’<a href="http://localhost/ville-de-massalia/wp-admin/?page=wpseo_configurator">extension$</a>";s:7:"options";a:8:{s:4:"type";s:7:"warning";s:2:"id";s:31:"wpseo-dismiss-onboarding-notice";s:5:"nonce";N;s:8:"priority";d:0.80000000000000004;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:14:"manage_options";s:16:"capability_check";s:3:"all";}}i:1;a:2:{s:7:"message";s:881:"Nous avons remarqué que vous utilisez Yoast SEO depuis un certain temps ; nous espérons que vous l’adorez ! Nous serions très heureux si vous pouviez <a href="https://yoa.st/rate-yoast-seo">nous attribuer 5 étoiles sur WordPress.org</a> !\n\nSi vous rencontrez des problèmes, <a href="https://yoa.st/bugreport">veuillez remplir un rapport de bug</a> et nous ferons notre possible pour vous aider.\n\nAu fait, savez-vous que nous avons aussi une <a href=''https://yoa.st/premium-notification''>extension Premium</a> ? Elle offre des fonctionnalités avancées, tel qu’un gestionnaire de redirection et la prise en charge des mots-clés multiples. Elle donne également accès à un support personnalisé 24/7.\n\n<a class="button" href="http://localhost/ville-de-massalia/wp-admin/?page=wpseo_dashboard&yoast_dismiss=upsell">Merci de ne plus m’afficher cette notification</a>";s:7:"options";a:8:{s:4:"type";s:7:"warning";s:2:"id";s:19:"wpseo-upsell-notice";s:5:"nonce";N;s:8:"priority";d:0.80000000000000004;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:14:"manage_options";s:16:"capability_check";s:3:"all";}}i:2;a:2:{s:7:"message";s:203:"Ne ratez pas vos erreurs d’exploration : <a href="http://localhost/ville-de-massalia/wp-admin/admin.php?page=wpseo_search_console&tab=settings">connectez-vous avec votre Google Search Console ici</a>.";s:7:"options";a:8:{s:4:"type";s:7:"warning";s:2:"id";s:17:"wpseo-dismiss-gsc";s:5:"nonce";N;s:8:"priority";d:0.5;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:14:"manage_options";s:16:"capability_check";s:3:"all";}}i:3;a:2:{s:7:"message";s:313:"<strong>Important problème SEO&nbsp;: Vous bloquez actuellement l’accès aux robots des moteurs de recherche. </strong> Vous devez vous <a href="http://localhost/ville-de-massalia/wp-admin/options-reading.php">rendre dans vos Réglages de Lecture</a> et décocher la case Visibilité  des moteurs de recherche.";s:7:"options";a:8:{s:4:"type";s:5:"error";s:2:"id";s:32:"wpseo-dismiss-blog-public-notice";s:5:"nonce";N;s:8:"priority";i:1;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:14:"manage_options";s:16:"capability_check";s:3:"all";}}}'),
