(127, '_transient_feed_76f8d9281c01f21e505004d0986f50c6', 'a:4:{s:5:"child";a:1:{s:0:"";a:1:{s:3:"rss";a:1:{i:0;a:6:{s:4:"data";s:5:"\n		\n	";s:7:"attribs";a:1:{s:0:"";a:1:{s:7:"version";s:3:"2.0";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:1:{s:7:"channel";a:1:{i:0;a:6:{s:4:"data";s:79:"\n		\n		\n		\n		\n		\n		\n					\n						\n						\n						\n						\n						\n						\n						\n					";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:30:"Planète WordPress Francophone";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:17:"https://wpfr.net/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:49:"Toute l’actualité de WordPress en français !";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"language";a:1:{i:0;a:5:{s:4:"data";s:5:"fr-FR";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"item";a:8:{i:0;a:6:{s:4:"data";s:84:"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:84:"Thank you Sucuri and Gravity Forms for being the amazing #WCEU after party sponsors!";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpfr/~3/Ac8dzImmKfg/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:127:"https://2017.europe.wordcamp.org/2017/06/09/thank-you-sucuri-and-gravity-forms-for-being-the-amazing-wceu-after-party-sponsors/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 09 Jun 2017 11:50:22 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:350:"\n		        You probably know everything about the after party by now, including the after party theme we announced just a couple of days ago. But what you might not know yet, is that it&#8217;s all possible thanks to our amazing after party sponsors – Sucuri and Gravity Forms. Sucuri You have sponsored WordCamps all over. What [&#8230;]		        ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"WordCamp Europe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3084:"<p><img class="aligncenter size-full wp-image-7300" src="http://2017.europe.wordcamp.org/files/2017/06/afterparty-sponsors.jpg" alt="" width="1400" height="800" />You probably know everything about the after party by now, including the <a href="http://2017.europe.wordcamp.org/2017/06/06/about-that-after-party/">after party theme</a> we announced just a couple of days ago. But what you might not know yet, is that it&#8217;s all possible thanks to our amazing after party sponsors – <a href="https://sucuri.net/">Sucuri</a> and <a href="http://www.gravityforms.com/">Gravity Forms</a>.</p>\n<p><span id="more-7286"></span></p>\n<h2>Sucuri</h2>\n<p><strong>You have sponsored WordCamps all over. What is your primary motivation for sponsoring them and what are your expectations for WordCamp Europe in Paris?</strong></p>\n<p>Sucuri has actively participated in WordCamps since our inception. Over the years we’ve worked to balance our event sponsorships across platforms and industries to help reach our core audiences and supporters. WCEU in Paris is an opportunity for the Sucuri team to connect with our WP community of friends.</p>\n<p><strong>What have you got in store for us for the after party? Are there any surprises you’re planning for our attendees?</strong></p>\n<p>We’re excited to be the sponsor for this year’s after party in Paris and hope all attendees have a safe and enjoyable experience to remember. We wouldn’t be a security company without exercising the concept of least privilege; we’ll all just have to wait and see what the event brings.</p>\n<p><strong>What’s coming up next for Sucuri, and what will change with the GoDaddy acquisition?</strong></p>\n<p>Sucuri 2.0 is in full swing, and we’re working hard to continue improvements to the technology and user experience. The acquisition empowers us to deploy our technology stack across one of the largest hosting providers in the world, further enabling us to expand our research and strengthen our defences for our customers.</p>\n<h2>Gravity Forms</h2>\n<p>Gravity Forms lets you build and publish your WordPress forms in just minutes. No drudgery, just quick and easy form-building. Select your fields, configure your options and easily embed forms on your WordPress powered site using the built-in tools. That&#8217;s way more satisfying (and less fattening) than a peanutty candy bar any day.</p>\n<p><strong>Thank you Sucuri and Gravity Forms for sponsoring WordCamp Europe 2017!</strong></p>\n<hr />\n<h2>Say hello to #WCEU sponsors</h2>\n<p>Sponsors are one of the most important parts of WordCamp Europe. With their help we keep the ticket price low, and the conference open to everyone. While in Paris, say hello to them, and talk with them about their products and services. Wondering who these companies are? Visit the <a href="http://2017.europe.wordcamp.org/sponsors/">sponsors</a> page.</p>\n<p><strong>Thank you to our sponsors for being an important part of WordCamp Europe &lt;3</strong></p><img src="http://feeds.feedburner.com/~r/wpfr/~4/Ac8dzImmKfg" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:127:"https://2017.europe.wordcamp.org/2017/06/09/thank-you-sucuri-and-gravity-forms-for-being-the-amazing-wceu-after-party-sponsors/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:84:"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:44:"WordPress 4.8 « Evans » à télécharger";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpfr/~3/x9q6_cjOdVI/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:56:"https://wpchannel.com/wordpress-4-8-evans-a-telecharger/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 09 Jun 2017 09:40:31 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:464:"\n		        WordPress 4.8 dénommée « Evans », en l’honneur du pianiste de jazz et compositeur  William John &#171;&#160;Bill&#160;&#187; Evans, est disponible au téléchargement depuis votre administration. Les nouvelles fonctionnalités 