r party…";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpfr/~3/DYo5uxAjXSo/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:67:"https://2017.europe.wordcamp.org/2017/06/06/about-that-after-party/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 06 Jun 2017 11:35:05 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:345:"\n		        A lot of you asked – will the afterparty have a theme this year? The short answer is yes, but if you want to learn more about the afterparty and what will wait for you there – read on. We have already announced the beautiful afterparty venue. It&#8217;ll take place at Le Pavillon d’Armenonville, an amazing [&#8230;]		        ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"WordCamp Europe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3646:"<figure id="attachment_6957" style="width: 1400px" class="wp-caption aligncenter"><img class="size-full wp-image-6957" src="http://2017.europe.wordcamp.org/files/2017/06/after-party.jpg" alt="" width="1400" height="800" /><figcaption class="wp-caption-text">WordCamp Europe 2017 afterparty will be about – Paris in the 1930s &lt;3</figcaption></figure>\n<p>A lot of you asked – will the afterparty have a theme this year? The short answer is yes, but if you want to learn more about the afterparty and what will wait for you there – read on.</p>\n<p><span id="more-6925"></span></p>\n<p>We have already <a href="http://2017.europe.wordcamp.org/2017/03/31/get-the-wceu-afterparty-started/">announced the beautiful afterparty venue</a>. It&#8217;ll take place at <strong>Le Pavillon d’Armenonville</strong>, an amazing building just on the outskirts of Paris in the Bois de Boulogne park, with a view over a lake. Once a modest hunting lodge, on <strong>Saturday, June 17th</strong>, it will host hundreds of WordPress people ready to party.</p>\n<h2>Party Theme</h2>\n<blockquote class="twitter-tweet">\n<p lang="en" dir="ltr">Hey <a href="https://twitter.com/WCEurope">@WCEurope</a>,</p>\n<p>Last year y&#039;all had a ball.</p>\n<p>What&#039;s the After Party Dress Code this year?<a href="https://twitter.com/hashtag/AskingForAFriend?src=hash">#AskingForAFriend</a><a href="https://twitter.com/hashtag/WCEU?src=hash">#WCEU</a></p>\n<p>&mdash; Bridget Willard (@YouTooCanBeGuru) <a href="https://twitter.com/YouTooCanBeGuru/status/870101869850378240">June 1, 2017</a></p></blockquote>\n<p></p>\n<p>So, <strong>afterparty theme</strong>. You have asked us on <a href="https://twitter.com/youtoocanbeguru/status/870101869850378240">social networks</a>, in the comments and in person. We&#8217;re happy to announce the afterparty theme – <strong>the 1930s Paris</strong>. &#8220;Wow, the 1930s Paris?&#8221; – you may ask yourself – &#8220;How should I prepare?&#8221; <strong>Worry no more.</strong> As with everything we did to let you feel welcome while in Paris, we have a perfect video that explains it.</p>\n<div class="jetpack-video-wrapper"></div>\n<h2>Things you need to know about the afterparty</h2>\n<ul>\n<li>afterparty will take place in the beautiful <strong><a href="https://goo.gl/maps/r8fZqqKegWw">Pavillon d’Armenonville</a>, Allée de Longchamp, Bois de Boulogne, 75116 Paris</strong>.</li>\n<li>afterparty starts at <strong>8 pm on Saturday 17th</strong> (and lasts until 3am).</li>\n<li>to get there <strong>take Metro Line 1 or RER line C to Porte Maillot station</strong>, and then <strong>take Exit 6</strong>. There, you can <strong>take the after party train</strong> (you&#8217;ll see it, it is in the WordCamp Europe colors) or <strong>you can have a walk</strong>. There’s a 5-minute walk through the greenery of Bois de Boulogne to get to the after party venue.</li>\n<li><strong>we will have food trucks at the afterparty</strong>, offering a variety of different food. That&#8217;s why we recommend going to the afterparty straight after the conference.</li>\n<li>you will get <strong>one free wine or beer</strong>, or <strong>two free soft drinks</strong>. Afterwards, you can purchase drink tickets for 2€ (soft drink), 4€ (wine/beer) or 5€ (cocktails).</li>\n<li>yes, we will have a <strong>photo booth.</strong> <img src="https://s.w.org/images/core/emoji/2.3/72x72/1f609.png" alt="😉" class="wp-smiley" style="height: 1em;max-height: 1em" /></li>\n</ul>\n<p>And remember – what happens in Paris&#8230;</p><img src="http://feeds.feedburner.com/~r/wpfr/~4/DYo5uxAjXSo" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:67:"https://2017.europe.wordcamp.org/2017/06/06/about-that-after-party/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:84:"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:42:"WordPress et la puissance des commentaires";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/