(8, 1, '2017-06-12 10:57:58', '0000-00-00 00:00:00', 'Bienvenue sur votre site ! C’est votre page d’accueil que vos visiteurs verront lorsqu’ils arriveront sur votre site la première fois.', 'Accueil', '', 'auto-draft', 'closed', 'closed', '', '', '', '', '2017-06-12 10:57:58', '0000-00-00 00:00:00', '', 0, 'http://localhost/FORMATION/wordpress/?page_id=8', 0, 'page', '', 0),
(9, 1, '2017-06-12 10:57:58', '0000-00-00 00:00:00', 'Vous pourriez être un artiste et vouloir présenter vos travaux et vous même ou encore être une entreprise avec une mission à promouvoir.', 'À propos de', '', 'auto-draft', 'closed', 'closed', '', '', '', '', '2017-06-12 10:57:58', '0000-00-00 00:00:00', '', 0, 'http://localhost/FORMATION/wordpress/?page_id=9', 0, 'page', '', 0),
(10, 1, '2017-06-12 10:57:58', '0000-00-00 00:00:00', 'C’est une page avec des informations de contact de base, comme l’adresse et le numéro de téléphone. Vous pouvez aussi essayer une extension pour ajouter un formulaire de contact.', 'Contact', '', 'auto-draft', 'closed', 'closed', '', '', '', '', '2017-06-12 10:57:58', '0000-00-00 00:00:00', '', 0, 'http://localhost/FORMATION/wordpress/?page_id=10', 0, 'page', '', 0),
