(12, 1, '2017-06-12 10:57:58', '0000-00-00 00:00:00', 'C’est un exemple de section de page d’accueil. Les sections de page d’accueil peuvent être n’importe quelle page autre que la page d’accueil elle-même, y compris la page qui affiche vos derniers articles de blog.', 'Une section de page d’accueil', '', 'auto-draft', 'closed', 'closed', '', '', '', '', '2017-06-12 10:57:58', '0000-00-00 00:00:00', '', 0, 'http://localhost/FORMATION/wordpress/?page_id=12', 0, 'page', '', 0),
