(14, 1, '2017-06-12 11:57:12', '2017-06-12 09:57:12', '<div>\r\n\r\nLe <strong>Lorem Ipsum</strong> est simplement du faux texte employé dans la <span style="color: #ff00ff;">composition et la mise en page avant impression</span>. Le Lorem Ipsum est le faux texte standard de l''imprimerie depuis les années 1500, quand un peintre anonyme assembla ensemble des morceaux de texte pour réaliser\r\n\r\nun livre spécimen de polices de texte. Il n''a pas fait que survivre cinq siècles, mais s''est aussi adapté à la bureautique informatique, sans que son contenu n''en soit modifié. Il a été popularisé dans les années 1960 grâce à la vente de feuilles Letraset contenant des passages du Lorem Ipsum, et, plus récemment, par son inclusion dans des applications de mise en page de texte, comme Aldus PageMaker.\r\n\r\n</div>\r\n<div>\r\n\r\nOn sait depuis longtemps que travailler avec du texte lisible et contenant du sens est source de distractions, et empêche de se concentrer sur la mise en page elle-même. L''avantage du Lorem Ipsum sur un texte générique comme ''Du texte. Du texte. Du texte.'' est qu''il possède une distribution de\r\n\r\n<img class="alignleft wp-image-16" src="http://localhost/FORMATION/wordpress/wp-content/uploads/2017/06/sea-2361247_960_720.jpg" alt="Tortue" width="251" height="188" />lettres plus ou moins normale, et en tout cas comparable avec celle du français standard. De nombreuses suites logicielles de mise en page ou éditeurs de sites Web ont fait du Lorem Ipsum leur faux texte par défaut, et une recherche pour ''Lorem Ipsum'' vous conduira vers de nombreux sites qui n''en sont encore qu''à leur phase de construction. Plusieurs versions sont apparues avec le temps, parfois par accident, souvent intentionnellement (histoire d''y rajouter de petits clins d''oeil, voire des phrases embarassantes).\r\n\r\n</div>', 'Voyage en Martinique', '', 'publish', 'open', 'open', '', 'voyage-en-martinique', '', '', '2017-06-12 12:14:40', '2017-06-12 10:14:40', '', 0, '