(26, 1, '2017-06-12 12:06:31', '2017-06-12 10:06:31', '<h3>L''Allemagne humiliée !</h3>\r\nNon, ce Mondial, c''est aussi les adieux de Michael Laudrup qui nous régale une dernière fois d''un récital en quart de finale contre le Brésil. C''est la frappe du gauche du Croate Robert Jarni qui humilie définitivement l''Allemagne (défaite 3-0 en quart de finale). Ce sont les matches fabuleux de l''Angleterre contre la Roumanie au premier tour et face à l''Argentine en huitième de finale. C''est le but d''anthologie de Dennis Bergkamp contre l''Argentine au Vélodrome ou celui de Michael Owen contre cette même Albiceleste. Ce sont les dribbles du Nigérian Jay-Jay Okocha qui émerveilleront tellement le commentateur de Canal+ Charles Biétry que ce dernier, une fois désigné président du PSG, le fera venir dans le club de la capitale. C''est la polémique d''arbitrage à propos du match Brésil-Norvège qui commence par une diatribe contre l''homme en noir qu''on accuse d''avoir accordé un penalty imaginaire aux Nordiques avant de constater qu''il y avait finalement faute. Entre-temps, le Maroc, lésé indirectement par ce penalty qui précipite son élimination dans le groupe A, criera au complot et s''estimera, à tort, aussi floué que l''Algérie de 1982.\r\n\r\nFrance 98, c''est aussi de l''extrasportif savoureux. C''est le sex appeal des supportrices de la Jamaïque qui érotisent les tribunes en faisant du topless. C''est le visage magnifique des supportrices perses dont le sourire et le regard étourdissent même les caméramans. C''est ce match de la paix entre l''Iran et les États-Unis qui adoucit les relations entre les deux pays bien plus qu''une négociation diplomatique. C''est le président Jacques Chirac qui peine à hurler les noms des Bleus par manque de connaissance lors de la finale au moment de l''entrée des joueurs. C''est aussi, hélas, le décès du dernier président compétent de la Fédération française de football de 1972 à 1984 Fernand Sastre (qui était aussi coprésident avec Platini du comité d''organisation du Mondial) survenu peu de temps après l''ouverture du tournoi.\r\n\r\nEt c''est pourquoi cette Coupe du monde 1998 n''est pas seulement magnifique au regard de la victoire des Bleus. Celle-ci ne souffre aucune contestation sur le plan sportif malgré certains esprits chagrins qui estiment que la crise d''épilepsie de Ronaldo avant le match a joué sur le scénario du dernier acte. Comme si c''était la première fois qu''un fait de ce type venait perturber une finale de Coupe du monde...', 'Le Monde en Bleu !', '', 'publish', 'open', 'open', '', 'le-monde-en-bleu', '', '', '2017-06-12 12:06:31', '2017-06-12 10:06:31', '', 0, 'http://localhost/FORMATION/wordpress/?p=26', 0, 'post', '', 0),
