(29, 1, '2017-06-12 12:09:32', '2017-06-12 10:09:32', '<header class="article__header js-article__header">\r\n<h1 class=" title article__titre article__titre--sm"><span style="color: #008000;"><strong>Roland-Garros : Rafael Nadal corrige Stan Wawrinka en finale et remporte son dixième titre</strong></span></h1>\r\n<h2 class="article__chapeau">Rafael Nadal a joué une grande finale, dimanche à Roland-Garros, face à Stan Wawrinka (6-2, 6-3, 6-1, en 2h05), devenant le premier joueur de l''ère Open à conquérir dix fois le même Grand Chelem. Il revient à trois unités de Roger Federer, l''autre grand monsieur de l''année 2017.</h2>\r\n</header>\r\n<div class="article__main js-article__main">\r\n<p class="article__paragraphe article__paragraphe--last" data-type="Accroche">Il aura donc fallu trois ans à Rafael Nadal pour conquérir <a href="https://www.lequipe.fr/Tennis/TennisPalmaresRG_F_M.html" target="_blank" rel="noopener">son dixième titre, la fameuse <em>décima</em>, à Roland-Garros</a>. L''Espagnol (31 ans) y aura mis la manière, comme à sa grande époque, et même mieux, si l''on se fie à cette statistique ahurissante : 35 jeux perdus en sept rencontres (record personnel amélioré de six unités), dont six en finale, dimanche après-midi, face à celui qu''on présentait comme son plus féroce rival de toute la quinzaine, Stan Wawrinka (6-2, 6-3, 6-1, en 2h05). Le Suisse (32 ans, 3e), sans doute émoussé 48 heures après sa demie dantesque contre Murray (4h34), aura été bien impuissant face au roi de la terre (24-1 cette saison), de retour lundi à la deuxième place mondiale. En 2017, les patrons, c''est Federer et Nadal. Vous avez dit <em>vintage</em> ?</p>\r\nNous reviennent ces deux balles de 5-3 pour Benoît Paire, au deuxième set de son premier tour face au Majorquin sur le Lenglen : l''Avignonnais aura été, tout compte fait, le plus proche (cinq points) de chiper une manche à Nadal, qui a élevé son niveau<em> crescendo</em> au fil du tournoi. Jusqu''à atteindre un nouveau sommet personnel ? On peut le penser, notamment côté revers. Il y a eu la correction, face à Basilashvili (un jeu perdu), et puis surtout ces deux gifles, infligées à Dominic Thiem, en demie, puis Stan Wawrinka ce dimanche. Clin d''œil de l''histoire : l''Autrichien et le Suisse avaient marqué exactement le même nombre de jeux lors de leur premier duel Porte d''Auteuil face à l''Espagnol (7 et 6).\r\n\r\n</div>', 'Rafa encore champion !', '', 'publish', 'open', 'open', '', 'rafa-encore-champion', '', '', '2017-06-12 12:14:22', '2017-06-12 10:14:22', '', 0, 'http://localhost/FORMATION/wordpress/?p=29', 0, 'post', '', 0),
