(37, 1, '2017-06-12 12:14:00', '2017-06-12 10:14:00', 'CINÉMA - Le septième chapitre de "<a href="http://www.huffingtonpost.fr/news/Star%20Wars/" target="_blank" rel="noopener">Star Wars</a>" annonçait le retour de Luke Skywalker, "The Last Jedi" le concrétise. 34 ans après la première trilogie, <a href="http://www.huffingtonpost.fr/news/Mark%20Hamill/" target="_blank" rel="noopener">Mark Hamill</a> endosse à nouveau le costume du Jedi. Mais pour lui, la déception est peut-être aussi grande que l''impatience des fans.\r\n<div id="entry_paragraph_1" class="ad_spot entry-body--paragraph-ad "></div>\r\n<a href="http://www.vanityfair.fr/" target="_blank" rel="noopener">Vanity Fair</a> a célébré le quarantième anniversaire de la saga, le 24 mai, en dévoilant <a href="http://www.huffingtonpost.fr/2017/05/24/star-wars-episode-viii-voila-a-quoi-ressemblent-benicio-del_a_22107587/?utm_hp_ref=fr-star-wars" target="_blank" rel="noopener">quatre couvertures</a> dédiées aux personnages du huitième volet de l''univers créé par <a href="http://www.huffingtonpost.fr/news/George%20Lucas/" target="_blank" rel="noopener">George Lucas</a>. En plus des nouvelles images du film, les pages du magazine contiennent une confession de Mark Hamill. Et pas des moindres.\r\n<div id="entry_paragraph_2" class="ad_spot entry-body--paragraph-ad "></div>\r\nL''acteur américain affirme être en total désaccord avec les choix du réalisateur <a href="http://www.huffingtonpost.fr/news/Rian%20Johnson/" target="_blank" rel="noopener">Rian Johnson</a>. "Après avoir lu le scénario, j''avais un truc à dire à Rian: ''Je suis fondamentalement en désaccord avec tous les choix que tu as fait pour Luke. Maintenant que j''ai dit ce que j''avais à dire, je suis soulagé. Désormais, mon boulot est de tout faire pour me rapprocher le plus de la vision que tu as pour le personnage''", avoue-t-il. Cette révélation est d''autant plus rare que, pour la sortie d''un tel blockbuster, les acteurs révèlent rarement ce qui ne va pas à la presse...\r\n<div id="entry_paragraph_3" class="ad_spot entry-body--paragraph-ad "></div>\r\nDe quels "choix" parlent Mark Hamill? La <a href="http://www.huffingtonpost.fr/2017/04/14/avez-vous-remarque-ces-5-details-dans-la-bande-annonce-de-star-w_a_22039903/?utm_hp_ref=fr-star-wars" target="_blank" rel="noopener">bande-annonce de l''épisode VIII</a> montre déjà la vision radicale de Luke Skywalker sur le futur des jedis. "Il est temps pour les jedis de s''éteindre", annonce-t-il d''une voix solennelle. Est-ce le point de désaccord entre le producteur et Mark Hamill? Pour en savoir plus, il faudra attendre le 13 décembre prochain.', 'Star Wars 8 : le Dernier Jedi est pour bientôt !', '', 'publish', 'open', 'open', '', 'star-wars-8-le-dernier-jedi-est-pour-bientot', '', '', '2017-06-12 12:18:30', '2017-06-12 10:18:30', '', 0, 'http://localhost/FORMATION/wordpress/?p=37', 0, 'post', '', 0),
