(40, 1, '2017-06-12 12:17:07', '2017-06-12 10:17:07', '<strong>Ce 30 juin marque la sortie du septième album de Jul (le douzième en comptant ses mixtapes). <em>Je ne me vois pas briller</em> est donc la collection printemps-été d’un rappeur qui abreuve ses fans en toutes saisons.</strong>\r\n<h2><strong>Marseille au cœur</strong></h2>\r\n<strong><a href="http://www.fnac.com/SCH/ia405045" target="_blank" rel="noopener">SCH</a></strong>, <strong><a href="http://www.fnac.com/Lacrim/ia1161909" target="_blank" rel="noopener">Lacrim</a></strong>, les vétérans d’<strong><a href="http://www.fnac.com/IAM/ia261258" target="_blank" rel="noopener">IAM</a></strong>, <strong><a href="http://www.fnac.com/Soprano/ia548711" target="_blank" rel="noopener">Soprano</a></strong>, <strong><a href="http://www.fnac.com/Alonzo/ia789411" target="_blank" rel="noopener">Alonzo</a></strong>… Le rap marseillais n’en finit pas d’alimenter le monde du hip-hop, avec pléthores d’artistes et de sorties, mois après mois. <strong><a href="http://www.fnac.com/Jul/ia1142154" target="_blank" rel="noopener">Jul</a></strong> figure en tête de cette scène, avec des chiffres de vente qui défient toute concurrence. Depuis 2013, avec sa formule originale (instrus festifs et rap hardcore), le jeune homme a conquis tout l’Hexagone.\r\n<h2><strong>Tout ce qui brille<a title="Je ne me vois pas briller - Jul" href="http://musique.fnac.com/a10645434/Jul-Je-ne-me-vois-pas-briller-CD-album" target="_blank" rel="noopener"><img class="floatr" src="http://static.fnac-static.com/multimedia/Images/FD/Comete/89188/CCP_IMG_ORIGINAL/1131139.jpg" alt="Je-ne-me-vois-pas-briller" /></a></strong></h2>\r\nSon nouveau disque, <strong><a href="http://musique.fnac.com/a10645434/Jul-Je-ne-me-vois-pas-briller-CD-album" target="_blank" rel="noopener"><em>Je ne me vois pas briller</em></a></strong>, succède donc à <strong><a href="http://musique.fnac.com/a10191471/Jul-L-Ovni-CD-album" target="_blank" rel="noopener"><em>L’Ovni</em></a></strong>, sorti en décembre dernier, et à son troisième album gratuit paru en mars. Dès la publication du premier extrait, éponyme, les fans ont pu constater que Jul ne déviait pas de sa trajectoire, et qu’aucun signe d’essoufflement n’ombrageait cette future sortie. Quoiqu’en pensent les haters, il va falloir compter sur le rappeur à scooter Yamaha pour de bon !', 'Jul brille quand même', '', 'publish', 'open', 'open', '', 'jul-brille-quand-meme', '', '', '2017-06-12 15:40:15', '2017-06-12 13:40:15', '', 0, 'http://localhost/FORMATION/wordpress/?p=40', 0, 'post', '', 0),
