rong>, sorti en décembre dernier, et à son troisième album gratuit paru en mars. Dès la publication du premier extrait, éponyme, les fans ont pu constater que Jul ne déviait pas de sa trajectoire, et qu’aucun signe d’essoufflement n’ombrageait cette future sortie. Quoiqu’en pensent les haters, il va falloir compter sur le rappeur à scooter Yamaha pour de bon !', 'Jul brille quand même', '', 'inherit', 'closed', 'closed', '', '40-revision-v1', '', '', '2017-06-12 12:17:07', '2017-06-12 10:17:07', '', 40, 'http://localhost/FORMATION/wordpress/2017/06/12/40-revision-v1/', 0, 'revision', '', 0),
