(46, 1, '2017-06-12 12:22:21', '2017-06-12 10:22:21', '<header>\r\n<h1 class="entry-title">Japon. Un bébé panda naît au zoo de Tokyo</h1>\r\n</header>\r\n<div id="article-content" class="article-content p402_premium ads_inread_content">\r\n<p class="description">Un bébé panda d’environ 150 g est né au zoo Ueno de Tokyo. Le sexe du petit animal, né sans poil, n’a pas encore pu être déterminé.</p>\r\n\r\n<div class="MediaCard-widthConstraint js-cspForcedStyle" data-style="max-width: 640px">\r\n<div class="MediaCard-mediaContainer js-cspForcedStyle" data-style="padding-bottom: 56.2500%"><a class="MediaCard-mediaAsset NaturalImage " href="https://twitter.com/TokyoZooNet_PR/status/874130154737377280/photo/1" data-scribe="element:photo"><img class="NaturalImage-image" title="上野動物園のジャイアントパンダ「シンシン」" src="https://pbs.twimg.com/media/DCGIjtVVYAAzYvk.jpg:small" alt="上野動物園のジャイアントパンダ「シンシン」" width="640" height="360" data-srcset="https%3A%2F%2Fpbs.twimg.com%2Fmedia%2FDCGIjtVVYAAzYvk.jpg%3Asmall 640w,https%3A%2F%2Fpbs.twimg.com%2Fmedia%2FDCGIjtVVYAAzYvk.jpg%3Alarge 640w,https%3A%2F%2Fpbs.twimg.com%2Fmedia%2FDCGIjtVVYAAzYvk.jpg 640w" /></a></div>\r\n</div>\r\n<div class="tag-html"></div>\r\nLa maman Shin Shin, 11 ans, 110 kg, a mis bas peu avant midi, ont annoncé les responsables du zoo dans un communiqué. Le nouveau-né, constamment serré contre sa mère, n’a pu être pesé mais son poids est estimé à 150 g, ont-ils précisé. Une vidéo de la naissance du petit a été mise en ligne par le zoo.\r\n\r\nLes pandas arrivent au monde roses, sans fourrure. <strong>« Il est souvent difficile d’en déterminer le sexe »</strong>, a déclaré un porte-parole ajoutant que des erreurs de jugement ont parfois été commises.\r\n\r\nShin Shin, qui s’est accouplée avec Ri Ri en février, avait déjà donné naissance en 2012. Il s’agissait alors d’une première en 24 ans pour ce zoo mais le petit était mort de pneumonie six jours plus tard.\r\n\r\nLe mois dernier, devant l’éventualité d’un heureux événement, des foules étaient venues voir la future maman mâchonner tranquillement du bambou en se frottant le ventre, avant qu’elle ne soit isolée.\r\n<h3>Maladresse amoureuse</h3>\r\nLes pandas géants sont réputés pour leur maladresse en amour, le mâle ne sachant pas trop quand ni comment s’y prendre. Et lorsqu’il se décide enfin, l’étreinte est souvent trop brève. Or les femelles ne peuvent être fécondées que pendant une période de deux-trois jours par an.\r\n\r\nLa bonne nouvelle a eu un impact immédiat pour les commerces locaux, une enseigne de restaurants chinois voyant son action gagner 38 % en séance. La chaîne Totenko avait déjà enregistré en mai un bond du cours de son action à la nouvelle d’une possible grossesse. Son principal restaurant se trouve près du parc d’Ueno et la présence d’un bébé panda devrait attirer un grand nombre de visiteurs dans le quartier.\r\n\r\nSelon des estimations, il reste en liberté moins de 2 000 de ces grands ursidés au pelage noir et blanc et aux oreilles rondes, dans trois provinces du centre-sud de la Chine.\r\n\r\n</div>', 'Naissance d''un panda au Japon', '', 'publish', 'open', 'open', '', '46', '', '', '2017-06-12 12:24:52', '2017-06-12 10:24:52', '', 0, 'http://localhost/FORMATION/wordpress/?p=46', 0, 'post', '', 0),
