(80, 1, '2017-06-12 15:20:37', '2017-06-12 13:20:37', '<h1 class="sectionShadow__title">Qui sommes-nous ?</h1>\r\n<div class="iframeResponsive iframeResponsive--half"><iframe src="https://player.vimeo.com/video/210912031" width="560" height="315" allowfullscreen="allowfullscreen" data-mce-fragment="1"></iframe></div>\r\n<div class="space-top-big space-bottom"><strong>OpenClassrooms veut rendre l''éducation accessible à tous et favorise un apprentissage communautaire et engageant.</strong></div>\r\nNous vous proposons des cours ouverts pour vous former autrement, pour devenir acteur de votre vie. Nous vous aidons à prendre votre envol, mais ça ne s''arrête pas là. Notre volonté est de vous accompagner tout au long de votre vie, dans votre parcours professionnel.\r\n\r\nNous, Mathieu Nebra et Pierre Dubuc, fondateurs d''OpenClassrooms et toute notre équipe de 35 personnes, sommes à vos côtés tous les jours. Curieux et férus de pédagogie et de technologie, nous n''avions que 13 et 11 ans lorsque nous avons commencé à travailler sur ce projet : proposer un cours d''informatique en ligne pour ceux qui veulent apprendre à coder. Rapidement une communauté de passionnés nous rejoignent et participent au développement du site en proposant également des cours.\r\n\r\nNous prenons en 2012, le virage des cours certifiants et nous sommes devenus en quelques années la plateforme de référence dans l''apprentissage du code, du numérique et de la culture digitale. Premier site d''e-Éducation en Europe avec près de 3 millions d''utilisateurs par mois et plus de 1000 cours en ligne, nous sommes dorénavant un champion français du secteur edTech et nous proposons désormais nos formations en entreprise.', 'Qui sommes nous', '', 'publish', 'closed', 'closed', '', 'qui-sommes-nous', '', '', '2017-06-12 15:20:37', '2017-06-12 13:20:37', '', 0, 'http://localhost/FORMATION/wordpress/?page_id=80', 0, 'page', '', 0),
